export const traderProfiles = {
  dayTrader: {
    layout: [
      { i: 'chart', x: 0, y: 0, w: 8, h: 8, minW: 4, maxW: 12 },
      { i: 'orderbook', x: 8, y: 0, w: 4, h: 8, minW: 3, maxW: 6 }
    ],
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'orderbook', type: 'orderbook' }
    ]
  },
  investor: {
    layout: [
      { i: 'chart', x: 0, y: 0, w: 8, h: 6, minW: 4, maxW: 12 },
      { i: 'fundamentals', x: 8, y: 0, w: 4, h: 6, minW: 3, maxW: 6 }
    ],
    widgets: [
      { i: 'chart', type: 'chart' },
      { i: 'fundamentals', type: 'fundamentals' }
    ]
  }
};
